import { gql } from "@apollo/client";

export default gql`
  {
    user2 {
      id
      email
      name
      age
      friends {
        id
        email
        name
        age
        posts
      }
      conversations {
        id
        email
        name
      }
      posts {
        id
        post
        time
      }
    }
  }
`;
